import React, {useEffect, useState} from 'react';
import AuthorizationPage from './AuthorizationPage'
import PortfolioPage from './PortfolioPage'
import './App.css';

function App() {
  let [hasAccess, setAccess] = useState(false);

  return (
    <div className='App'>
      {!hasAccess && <AuthorizationPage hasAccess={hasAccess} setAccess={setAccess} /> }
      {hasAccess && <PortfolioPage />}
    </div>
  );
}

export default App;
